import { useState } from "react";
import "./App.css";
import Snake from "./Snake";
import Food from "./Food";

function App() {
	const [snakeDots, setSnakeDots] = useState([
		[0, 0],
		[2, 0],
	]);

	const [foodDots, setFoodDots] = useState([[6, 5]]);

	// console.log(snakeDots);

	return (
		<div className="app">
			<div className="snake">
				<Snake snakeDots={snakeDots} />
				<Food dot={foodDots} />
			</div>
		</div>
	);
}

export default App;
